import './Navbar.css'
import React from 'react'
class Navbar extends React.Component {


    render(){
        return(
            <div className="navbar">

                <a className='Navbar-right' href="/login">Login</a>
                <a className='Navbar-right' href="/signup">Sign Up</a>

            </div>

        )
    }
}

export default Navbar
